import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import AppHeader from './Components/header';
import AppBanner from './Components/banner';
import AppWedo from './Components/wedo';
import AppWeserve from './Components/weserve';
import AppSave from './Components/savetime';
import AppMobile from './Components/mobile';
import AppClients from './Components/clients';

function App() {
  return (
    <div className="App">
      <header>
        <AppHeader />
      </header>
      <main>
        <AppBanner />
        <AppWedo />
        <AppWeserve />
        <AppSave />
        <AppMobile />
        <AppClients />
      </main>
    </div>
  );
}

export default App;
